  render() {
    return (
      <div className="App">
       <h1>Persons Info</h1>
        <Person name="Aman" age="31"/>
        <Person name="Roza" age="23">My Hobby: Playing</Person>
        <Person name="Tansen" age="29"/>
      </div>
    );
    //return React.createElement('div', {className:'App'}, React.createElement('h1', null,'Hi, I\'m a React App'));
  }
}

export default App;
